Let me think through this step by step...

The previous models primarily focus on self-interest, fairness, and their interactions.  However, they often use complex combinations of variables, potentially leading to high covariance between parameters and difficulty in parameter recovery.  Let's explore a simpler model that captures a core aspect of human decision-making:  **satisficing**.  People don't always strive for the optimal outcome; they often accept a "good enough" option.

This model will propose that responders have a minimum acceptable return *per token* they contributed.  If the offer exceeds this minimum, they accept; otherwise, they reject.  The minimum acceptable return per token could be influenced by their perceived fairness, which can be approximated by the ratio of their token contribution to the total tokens.

This leads to a model with two learnable parameters:
1.  `minimum_return_per_token`: The minimum return (in pounds) a responder requires per token found. This represents a satisficing threshold.
2.  `fairness_adjustment`:  A factor that adjusts the minimum acceptable return based on perceived fairness.  A higher value indicates a greater sensitivity to fairness; a value of 0 means the responder is insensitive to fairness.

The model will calculate the utility of accepting an offer as the difference between the actual return per token and the adjusted minimum acceptable return per token. A positive utility suggests a favorable offer.

<MODEL>
U_accept =  (split_self / token_self) - (minimum_return_per_token * (1 + fairness_adjustment * ( (token_self / (token_self + token_opp)) - 0.5 ) ))
</MODEL>

